css:
@-moz-document domain(codereddit.com) {
	body
	{
	    font-family:SourceCodePro-Medium;
	    background-color:#293134;
	    color:#7a8c93;
	}
	a
	{
	    color:#e0e2e4;
	    text-decoration:none;
	}
	a:hover
	{
	    text-decoration:underline;
	}

	.sh_preproc
	{
	    color:#93c75a!important;
	}

	.sh_comment
	{
	    color:#6f7878!important;
	}

	.sh_keyword
	{
	    color:#67bd63!important;
	}

	.sh_symbol
	{
	    color:#dae2d9!important;
	}

	.sh_variable
	{
		color:#e0e2e4!important;
    }

	.sh_class
	{
	    color:#90858f!important;
	}

	.sh_string
	{
	    color:#ec7600!important;
	}

	.sh_function
	{
        color:#9b7f89!important;
    }

	.sh_number
	{
        color:#ffcd22!important;
    }

	.indent
	{
	    padding-left:40px;
	}
}
